import React, { useEffect, useState, useCallback } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useCart } from './CartContext';
import '../css/Navbar.css';
import logo from '../css/vendor.jpg';
import defaultImage from '../css/vendor.jpg';

const Navbar = () => {
    const { cartItems, deleteCartItem, updateCartItemQuantity } = useCart();
    const navigate = useNavigate();
    const [cartDropdownVisible, setCartDropdownVisible] = useState(false);
    const [setUserRole] = useState(null);
    const [isTransparent, setIsTransparent] = useState(false);

    const fetchCartItems = useCallback(async () => {
        try {
            const token = localStorage.getItem('token');
            const response = await fetch('http://localhost:8080/cartitems', {
                headers: {
                    'Authorization': `Bearer ${token}`
                }
            });

            if (!response.ok) {
                throw new Error('Network response was not ok');
            }

            const data = await response.json();
            // Assuming you have a way to update the context with these items
            // e.g., updateCartItems(data.cart);
        } catch (error) {
            console.error('Error fetching cart items:', error);
        }
    }, []);

    useEffect(() => {
        fetchCartItems();
    }, [fetchCartItems]);

    useEffect(() => {
        const handleScroll = () => {
            setIsTransparent(window.scrollY > 50);
        };

        window.addEventListener('scroll', handleScroll);
        return () => {
            window.removeEventListener('scroll', handleScroll);
        };
    }, []);

    const handleSignOut = () => {
        localStorage.removeItem('token');
        setUserRole(null);
        navigate('/signin');
    };

    const toggleCartDropdown = () => {
        setCartDropdownVisible(!cartDropdownVisible);
    };

    const handleCheckout = async () => {
        console.log('Checkout button clicked');
        try {
            const token = localStorage.getItem('token');
            const response = await fetch('http://localhost:8080/checkout', {
                method: 'POST',
                headers: {
                    'Authorization': `Bearer ${token}`
                }
            });

            if (!response.ok) {
                throw new Error('Network response was not ok');
            }

            // Handle successful checkout
            console.log('Checkout successful');
            // Optionally clear cart items here if needed
        } catch (error) {
            console.error('Error during checkout:', error);
        }
    };

    return (
        <nav className={`navbar ${isTransparent ? 'transparent' : ''}`}>
            <div className="logo">
                <img src={logo} alt="Logo" />
            </div>
            <ul className="center-links">
                <li><Link to="/">Home</Link></li>
            </ul>
            <ul className="end-links">
                {/* User role checks and rendering */}
                <li>
                    <button onClick={toggleCartDropdown}>Cart</button>
                    {cartDropdownVisible && (
                        <div className="cart-dropdown">
                            {cartItems.length === 0 ? (
                                <p>No items in cart</p>
                            ) : (
                                <ul className="cart-list">
                                    {cartItems.map(item => (
                                        <li key={item.item_id} className="cart-item">
                                            <div className="cart-item-img">
                                                {item.img ? <img src={item.img} alt={item.name} /> : <img src={defaultImage} alt={item.name} />}
                                            </div>
                                            <div className="cart-item-name">{item.name}</div>
                                            <div className="cart-item-quantity">
                                                Qty: {item.quantity}
                                                <button onClick={() => updateCartItemQuantity(item.item_id, item.quantity + 1)}>+</button>
                                                <button onClick={() => updateCartItemQuantity(item.item_id, item.quantity - 1)}>-</button>
                                            </div>
                                            <button onClick={() => deleteCartItem(item.item_id)}>Remove</button>
                                        </li>
                                    ))}
                                </ul>
                            )}
                            <button onClick={handleCheckout}>Checkout</button>
                        </div>
                    )}
                </li>
                {/* Other user role items */}
            </ul>
        </nav>
    );
};

export default Navbar;
